import React from "react";
import { connect } from "react-redux";
import { getTeachers } from "../../reduser/data-reduser";
import Teachers from "./Teachers.jsx"


class TeacherCompanent extends React.Component {
    componentDidMount() {
        this.props.getTeachers()
    }

    render() {
        return <Teachers teachers={this.props.teachers} />;
    }
}

const mapStateToProps = (state) => ({
    teachers: state.data.teachers
});

export default connect(mapStateToProps, { getTeachers })(TeacherCompanent);
